import "./VcanciesItem.css"
import moment from "moment";


const VacanciesItem =({vac,department,vacancies})=> {
    console.log('vac=',vac)
    const date = moment().format('YYYY-MM-DD');

    return (
        <>
            <div>
                <div>{department}</div>
                {vacancies.map(vac => (
                    <div key={vac.id} className="angry-grid1">

                        <li id='item-01'>
                            <div id="item-01">{date === vac.create_date ? 'NEW' : ''}</div>

                            {vac.name}
                            {moment(vac.create_date).format('DD.MM.YYYY')}{vac.user_name}{vac.description}


                        </li>
                    </div>
                ))}
            </div>
        </>
    )
}

export default VacanciesItem
